ax - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"3220434","type":"CustomJS"},{"attributes":{"source":{"id":"3220055"}},"id":"3220298","type":"CDSView"},{"attributes":{},"id":"3220498","type":"AllLabels"},{"attributes":{},"id":"3220262","type":"DataRange1d"},{"attributes":{"axis":{"id":"3220217"},"coordinates":null,"group":null,"ticker":null},"id":"3220220","type":"Grid"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"3220277","type":"WheelZoomTool"},{"attributes":{},"id":"3220029","type":"LinearScale"},{"attributes":{"data":{},"selected":{"id":"3220130"},"selection_policy":{"id":"3220129"}},"id":"3220112","type":"ColumnDataSource"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","line_width":1.3,"x":{"field":"index"},"y":{"field":"aberration(H,L,C)_0_2"}},"id":"3220375","type":"Line"},{"attributes":{"axis_label":"Equity","coordinates":null,"formatter":{"id":"3220110"},"group":null,"major_label_policy":{"id":"3220121"},"minor_tick_line_color":null,"ticker":{"id"
